    [],nt"num_tags": 13,nt"name": "monitoring-study-of-experimental-well-water-use-at-stillwater-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This report provides a background on irrigation
    wells on Stillwater NWR. In 1978 a study was conducted to determine the suitability
    of the well water for growth and seed production of alkali bulrush, hardstem bulrush,
    sago pondweed, and wigeongrass. There was difficulty maintaining adequate water
    flows during this study, so a similar study was proposed for 1980.  A cost analysis
    for the 1980 study is provided in this report. A map of well locations is attached.",nt"owner_org":
